import React from "react";

// import components from material-ui
import { makeStyles } from "@material-ui/core/styles";
import { Box, Grid } from "@material-ui/core";

const useStyles = makeStyles({
  skillsBox: {
    backgroundColor: "pink",
    height: "6vh",
    color: "white",
    marginTop: "2rem"
  },
  skillDiv: {
    width: "70vw",
    fontSize: "20px"
  },
  icon: {
    width: "15vw",
    height: "15vh"
  }
});

function Skills() {
  const classes = useStyles();
  return (
    <>
      <div className={classes.skillDiv}>
        <Box
          className={classes.skillsBox}
          display="flex"
          justifyContent="center"
          alignItems="center"
        >
          <h1>Skills</h1>
        </Box>

        <Grid container align="center">
          <Grid item xs={12} md={3}>
            <p>HTML5</p>
            <img
                src={require(`../assets/icons/html.png`).default}
                alt="screenshot of my project"
                className={classes.icon}
              ></img>
          </Grid>
          <Grid item xs={12} md={3}>
            <p>CSS3</p>
            <img
                src={require(`../assets/icons/html.png`).default}
                alt="screenshot of my project"
                className={classes.icon}
              ></img>
          </Grid>
          <Grid item xs={12} md={3}>
            <p>JavaScript</p>
            <img
                src={require(`../assets/icons/html.png`).default}
                alt="screenshot of my project"
                className={classes.icon}
              ></img>
          </Grid>
          <Grid item xs={12} md={3}>
            <p>ReactJS</p>
            <img
                src={require(`../assets/icons/html.png`).default}
                alt="screenshot of my project"
                className={classes.icon}
              ></img>
          </Grid>

          <Grid item xs={12} md={3}>
            <p>Node.js</p>
            <img
                src={require(`../assets/icons/html.png`).default}
                alt="screenshot of my project"
                className={classes.icon}
              ></img>
          </Grid>
          <Grid item xs={12} md={3}>
            <p>Express.js</p>
            <img
                src={require(`../assets/icons/html.png`).default}
                alt="screenshot of my project"
                className={classes.icon}
              ></img>
          </Grid>
          <Grid item xs={12} md={3}>
            <p>MongoDB</p>
            <img
                src={require(`../assets/icons/html.png`).default}
                alt="screenshot of my project"
                className={classes.icon}
              ></img>
          </Grid>
          <Grid item xs={12} md={3}>
            <p>MySQL</p>
            <img
                src={require(`../assets/icons/html.png`).default}
                alt="screenshot of my project"
                className={classes.icon}
              ></img>
          </Grid>

          <Grid item xs={12} md={3}>
            <p>Bootstrap</p>
            <img
                src={require(`../assets/icons/html.png`).default}
                alt="screenshot of my project"
                className={classes.icon}
              ></img>
          </Grid>
          <Grid item xs={12} md={3}>
            <p>Material-UI</p>
            <img
                src={require(`../assets/icons/html.png`).default}
                alt="screenshot of my project"
                className={classes.icon}
              ></img>
          </Grid>
          <Grid item xs={12} md={3}>
            <p>WordPress</p>
            <img
                src={require(`../assets/icons/html.png`).default}
                alt="screenshot of my project"
                className={classes.icon}
              ></img>
          </Grid>
          <Grid item xs={12} md={3} style={{marginBottom: "4rem"}}>
            <p>Squarespace</p>
            <img
                src={require(`../assets/icons/html.png`).default}
                alt="screenshot of my project"
                className={classes.icon}
              ></img>
          </Grid>

        </Grid>
      </div>
    </>
  );
}

export default Skills;
